import React from 'react';
import '../../App.css';

const Signup = () =>{
  return (
    <>
     <section className="signup">
      <div className="container mt-5">
        <div className="signup-content">
          <div className="signup-form">
            <h2 className="form-title">Sign up</h2>
          </div>
</div>
</div>
</section>
    </>
  )
} 
export default SignUp
